import React from 'react';
import hospimain from './Images/hospimain.jpeg'

function Imagecontainer() {
  return (
    <div className='contain'>
       <img
        src={hospimain}
        width="100%"
        alt="img should"
      />
      <button  class='btn'>Book</button>

    </div>
  )
}

export default Imagecontainer;
